import React, {useCallback, useEffect, useState} from 'react';
import { StyleSheet, Text, View } from 'react-native';
import {HeaderButtons, Item} from 'react-navigation-header-buttons'
import NavButton from '../components/NavButton'
import Odabir from "../components/Odabir";

const FilteriEkran = (props) => {
  const navigation= {props}
 const [begginer, postaviBeginner]=useState(false)
 const [intermediate, postaviIntermediate]=useState(false)
 const [expert, postaviExpert] = useState(false)
 const [oprema, postaviOpremu] =useState(false)

const spremiFiltere = useCallback( () => {
  const odabraniFilteri = 
  {
    begginer,
    intermediate,
    expert,
    oprema
  }
  console.log(odabraniFilteri)
}, [begginer,intermediate,expert,oprema])

useEffect( ()=> {
  props.navigation.setParams({spremi: spremiFiltere})
  },
  [spremiFiltere])


  return ( 
    <View style={stil.ekran}>
      <Text> Odaberite filtere za pretragu vje≈æbi:  </Text>
      <Odabir
        naslov= "Begginer"
        izbor={begginer}
        promjena= {change=> postaviBeginner(change) }
      />
      <Odabir
        naslov= "Intermediate"
        izbor={intermediate}
        promjena= {change=> postaviIntermediate(change) }
      />
      <Odabir
      naslov= "Expert"
      izbor={expert}
      promjena= {change=> postaviExpert(change) }
      /> 
      <Odabir
      naslov= "Equipment"
      izbor={oprema}
      promjena= {change=> postaviOpremu(change) }
      />
    </View>
  );
}
FilteriEkran.navigationOptions = (navData) => {
  return {
   HeaderTitle: "Filteri",
   headerLeft: () => <Text onPress={()=>{
     navData.navigation.toggleDrawer()
    }}> MENU</Text>,
// {
// return (
// <HeaderButtons HeaderButtonComponent={NavButton}>
// <Item
//  title='Izbornik' 
//  iconName='menu'
// onPress={()=>{
//   navData.navigation.toggleDrawer()
//   }}
//   />
// </HeaderButtons>
// )
// }	   
    headerRight: ()=> 
    <Text onPress={()=>{
      navData.navigation.getParam('spremi')
      console.log("spremam opcije.")
     }}> SAVE </Text>
// {
