//  iconName='save'
// onPress={()=>{
//   console.log("spremam opcije.")
//   }}
//   />
// </HeaderButtons>
//   )
// } 

   }
  }
const stil = StyleSheet.create({
  ekran: {
    flex: 1,
    marginTop:40,
    alignItems: "center",
  },
});

export default FilteriEkran
